                "about": "### <center>Инвестируйте в сеть медицинских центров «Клиники Столицы»</center>\n---\n<center>Медицинский центр - стабильный, прибыльный и социально-ориентированный бизнес, долей в котором можно гордиться</center>\n---\n<center><img src=\"https://src.kleos.ru/file/org_image/2020/4/1/file_mewid.jpg\" ...></center>\n\n- ###30 филиалов  \n*в сети (30 действующих центров, инвестиции пойдут еще на 10)*\n- ###363 млн ₽ / год \n*общая выручка сети*\n- ###36 250   \n*клиентов в базе*\n- ###20% \n*средняя рентабельность 1-й клиники*\n- ###1720 \n*видов лабораторных исследований*\n- ###155 \n*врачей*\n&nbsp;\n<center><img src=\"https://src.kleos.ru/file/org_image/2020/4/1/file_2qh1h.jpg\" ...></center>\n\n\n## <center>Рост рынка за 2021 год</center>\n---\n*<center>В 2021г в России численность оказанных медицинских \nприемов выросла на 12.8% относительно 2020г и составила 2,18 млрд приемов.</center>*\n<center><img src=\"https://businesstat.ru/images/diagrams/laboratory_services_russia_businesstat.png\" ...></center>\n\n*<center>20% - рост выручки филиалов за 2021 год</center>*\n<center><img src=\"https://www.provrach.ru/images/2017-4/31_05_17_1.png\" ...></center>\n&nbsp;\n\n#### <center>В кризис спрос на анализы только растет</center>\n_<center>*После пандемии 2020 года средняя выручка точек выросла на 23,44%</center>_\n\n>Ассоциация медицинских учреждений «Клиники Столицы» (до 2016 года — группа компаний СклифЛаб) основана в 2009 году.\n\n\n&nbsp;\n\n## <center>Чем мы занимаемся?</center>\n___\n#### <center>Мы предоставляем анализы:</center>\n\n- Клинические\n- Биохимические\n- Серологические\n- Иммунологические\n- Генетические\n\n#### <center>Специализированные кабинеты</center>\n\n<center>\nВ «Клиники Столицы» можно \nсделать ЭКГ, ЭХО-КГ, все виды УЗИ, \nпроконсультироваться у гинеколога, эндокринолога, \nкардиолога, терапевта, уролога, а также пройти \nсеансы оздоровительного, классического \nи расслабляющего массажа.</center>\n\n&nbsp;\n<center><img src=\"https://avatars.mds.yandex.net/get-altay/5316761/2a0000017b79eee613a14fd5389742174b4a/XXL\" ...></center>\n&nbsp;\n\n\n## <center>Как работает наш бизнес?</center>\n---\n- #### Пациент\n*Приходит сдавать анализы и записывается к врачам*\n- #### Отделение Клиники Столицы\n*Оформляет заказ и принимает биоматериал*\n- #### Служба логистики\n*Доставляет биоматериал из всех регионов в лабораторию*\n- #### Отделение Клиники Столицы\n*Выполняет исследование биоматериала*\n- #### Офис Клиники Столицы\n*Обеспечивает поддержку пациентов и лабораторных отделений*\n\n## <center>Бизнес в цифрах </center>\n#### <center>Показатели медицинских центров за 2021 г.</center>\n\n\n| &#128308; | &#128308; |\n| :: |::|\n| Город | Город | \n| Москва | Нальчик |\n| Выручка | Выручка |\n| 2 783 560 руб. / мес. | 1 499 340 руб. / мес. |\n| Рентабельность | Рентабельность |\n| 21% | 28% |\n| Прибыль | Прибыль |\n| 584 547 руб. | 460 184 руб. |\n\n| &#128308; | &#128308; |\n| :: |::|\n| Город | Город | \n| Тверь | Астрахань |\n| Выручка | Выручка |\n| 1 670 380 руб. / мес. | 1 213 950 руб. / мес. |\n| Рентабельность | Рентабельность |\n| 22% | 24% |\n| Прибыль | Прибыль |\n| 367 483 руб. | 310 407 руб. |\n\n&nbsp;\n<center><img src=\"https://src.kleos.ru/file/org_image/2020/4/1/file_lk7uy.jpg\" ...></center>\n&nbsp;\n## <center>Почему мы эффективны?</center>\n---\n<center>Привлекательность для пациентов</center>\n&nbsp;\n<center><img src=\"https://avatars.mds.yandex.net/get-altay/248099/2a0000015eb3edfe5bf37186dccc00d10116/XXL\" ...></center>\n&nbsp;\n- #### Цена\n*Низкая стоимость анализов при высоком качестве расходных материалов*\n- #### Ассортимент\n*Самый большой на рынке лабораторной диагностики РФ набор исследований*\n- #### Доверие профессионалов\n*Врачи рекомендуют «Клиники Столицы» своим пациентам*\n- #### Колл-центр\n*Поддержка пациентов 24/365: единый круглосуточнный контакт-центр*\n&nbsp;\n<center><img src=\"https://doctor-arbitailo.ru/uploads/zn/fv/028e5bcd672142549f3c1cfa5b1e99363d43e6dc.jpg\" ...></center>\n\n## <center>Многосторонняя IT-поддержка сети</center>\n---\n####1. IT-система\n*Собственнная IT-система для управленческого и финансового контроля лаборатории*\n####2. Точность выбора локации\n*Экспертный анализ качества локации с помощью уникальных геомаркетинговых данных*\n####3. Статистика \n*по количеству пациентов и объёму продаж с ежедневными и ежемесячными отчётами*\n####4. Аналитика \n*Комплексная бизнес-аналитика по отделению Microsoft Power Platform Bi Report*\n&nbsp;\n<center><img src=\"https://este-laser-clinic.ru/pics/4810d5512eebd41227b3c633bfcd83c5.jpg\" ...></center>\n\n## <center>Цель инвестиций</center>\n---\n<center>Открытие 10 прибыльно работающих медицинских центров в г. Москве и МО</center>\n&nbsp;\n<center><img src=\"https://elegra-med.ru/pics/bee4c6dec74290353d41c7618bf612e1.jpg\" ...></center>\n&nbsp;\n\n## <center>Инвестиционный раунд для масштабирования</center>\n---\n<center><img src=\"https://avatars.mds.yandex.net/get-altay/4581272/2a0000017a3e014d560f8994473f6b3add8e/XXL\" ...></center>\n\n###<center>Большая цель «Клиник Столицы» - это рост сети до 1000 филиалов по РФ и СНГ</center>\n\n<center>И текущая продажа акций - это лишь одна из серий раундов по привлечению капитала для масштабирования филиальной сети</center>\n \n&nbsp;\n\n<center><img src=\"https://irecommend.ru/sites/default/files/product-images/797270/MaQm0YAHIKt59xUkBvrg.png\" ...></center>\n&nbsp;\n\n## <center>Резюме по компании</center>\n---\n####Сайт компании: \n*https://stoclinic.ru/*\n\n####Дата запуска раунда:\n*20.07.2022*\n\n####Стадия развития компании:\n*Масштабирование*\n\n####Головной офис:\n*105005, город Москва, Бауманская ул, д. 7 стр. 1*\n&nbsp;\n&nbsp;",
